        <div className="Landing">
            <header>
                <div className="header-content">
                    <h1><strong>Agricultural Resources At Your Fingertips</strong></h1>
                    <h4>Let's #ENDCOV</h4>
                    <p>I am a...</p>

                    <Button>LGU Representative</Button> <Button>Supplier</Button>
                </div>
            </header>
            <main> 
                <h3>Who are we?</h3>
            </main>
        </div>
    );

}
